import React from "react"
import {IconButton, ListItem, ListItemSecondaryAction} from '@material-ui/core'
import {ArrowForwardIos} from '@material-ui/icons'


export const CustomList = ({children}) => {

    return (
        <ListItem button>
            {children}
            <ListItemSecondaryAction>
                <IconButton>
                    <ArrowForwardIos/>
                </IconButton>
            </ListItemSecondaryAction>
        </ListItem>
    )
};
